ind2=" "><subfield code="a">&#x5D8;&#x5D0;&#x5DC;&#x5E7;&#x5D9;&#x5DF;, &#x5D3;&#x5E9;&#x5D9;&#x5D9;. &#x5E8;. &#x5E8;.,</subfield><subfield code="d">1892-1973</subfield></datafield><datafield tag="400" ind1="1" ind2=" "><subfield code="a">&#x702C;&#x7530;&#x8C9E;&#x4E8C;,</subfield><subfield code="d">1892-1973</subfield></datafield><datafield tag="400" ind1="1" ind2=" "><subfield code="a">&#xD1A8;&#xD0A8;, J. R. R,</subfield><subfield code="d">1892-1973</subfield></datafield><datafield tag="400" ind1="1" ind2=" "><subfield code="a">T&#x2BB;olk&#x2BB;in, Jon &#x1E5A;onald &#x1E5A;uel,</subfield><subfield code="d">1892-1973</subfield></datafield><datafield tag="667" ind1=" " ind2=" "><subfield code="a">Machine-derived non-Latin script reference project.</subfield></datafield><datafield tag="667" ind1=" " ind2=" "><subfield code="a">Non-Latin script references not evaluated.</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Prikli&#x361;ucheni&#x361;a Toma Bombadila i drugie istorii, 1994:</subfield><subfield code="b">t.p. (Dzhon Ronal&#x2B9;d Ru&#x117;l Tolkin)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Vlastelin kolet&#x361;s, 1992:</subfield><subfield code="b">t.p. (Dzhon Ronal&#x2B9;d Ru&#x117;l Tolkin) cover (Dzh.R.R. Tolkin)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Contemporary authors online, 8 March 2013</subfield><subfield code="b">(J. R. R. Tolkien; Tolkien, John Ronald Reuel; born January 3, 1892, in Bloemfontein, South Africa; died of complications resulting from a bleeding gastric ulcer and a chest infection, September 2, 1973, in Bournemouth, England; Education: Exeter College, Oxford, B.A., 1915, M.A., 1919; author and scholar; professor at University of Leeds, Oxford University)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Di &#x1E25;avrus&#x300;e fun dem fingerl, c2014:</subfield><subfield code="b">t.p. (&#x5D3;&#x5D6;&#x5E9;&#x5D9;&#x5D9;. &#x5E8;. &#x5E8;. &#x5D8;&#x5D0;&#x5DC;&#x5E7;&#x5D9;&#x5DF; = Dzshey. R. R. &#x1E6C;ol&#x1E33;in)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">English Wikipedia website, viewed July 29, 2016:</subfield><subfield code="b">(John Ronald Reuel Tolkien CBE, FRSL (3 January 1892-2 September 1973), known by his pen name J. R. R. Tolkien, was an English writer, poet, philologist, and university professor who is best known as the author of the classic high-fantasy works The Hobbit, The Lord of the Rings, and The Silmarillion. He served as the Rawlinson and Bosworth Professor of Anglo-Saxon and Fellow of Pembroke College, Oxford, from 1925 to 1945 and Merton Professor of English Language and Literature and Fellow of Merton College, Oxford from 1945 to 1959. He was at one time a close friend of C. S. Lewis-they were both members of the informal literary discussion group known as the Inklings. Tolkien was appointed a Commander of the Order of the British Empire by Queen Elizabeth II on 28 March 1972. After Tolkien's death, his son Christopher published a series of works based on his father's extensive notes and unpublished manuscripts, including The Silmarillion. These, together with The Hobbit and The Lord of the Rings form a connected body of tales, poems, fictional histories, invented languages, and literary essays about a fantasy world called Arda, and Middle-earth within it. Between 1951 and 1955, Tolkien applied the term legendarium to the larger part of these writings)</subfield></datafield><datafield tag="905" ind1="" ind2=""><subfield code="u">admin</subfield></datafield></record>	0
