139	2021-08-05 10:05:30-05	2021-08-05 10:05:55.971664-05	import	<record xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns="http://www.loc.gov/MARC21/slim" xsi:schemaLocation="http://www.loc.gov/MARC21/slim http://www.loc.gov/standards/marcxml/schema/MARC21slim.xsd"><leader>02565cz  a2200349n  4500</leader><controlfield tag="001">192</controlfield><controlfield tag="005">20190124101116.4</controlfield><controlfield tag="008">141201|| anznnbabn          |a ana     c</controlfield><datafield tag="010" ind1=" " ind2=" "><subfield code="a">gf2014026297</subfield><subfield code="z">gf2011026277</subfield><subfield code="z">gf2011026647</subfield></datafield><datafield tag="035" ind1=" " ind2=" "><subfield code="a">(DLC)gf2014026297</subfield></datafield><datafield tag="040" ind1=" " ind2=" "><subfield code="a">IlChALCS</subfield><subfield code="b">eng</subfield><subfield code="c">DLC</subfield><subfield code="f">lcgft</subfield><subfield code="d">DLC</subfield></datafield><datafield tag="155" ind1=" " ind2=" "><subfield code="a">Drama</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Dramas</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="w">nne</subfield><subfield code="a">Filmed plays</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Plays</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Playscripts</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Scripts, Stage</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Stage plays</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Stage scripts</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="w">nne</subfield><subfield code="a">Televised plays</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Theatrical works</subfield></datafield><datafield tag="555" ind1=" " ind2=" "><subfield code="w">g</subfield><subfield code="a">Literature</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">LCSH, Oct. 22, 2014</subfield><subfield code="b">(Drama. UF Plays. BT Literature)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Abrams, M. A glossary of literary terms, c1999</subfield><subfield code="b">(Drama. The form of composition designed for performance in the theater, in which actors take the roles of the characters, perform the indicated action, and utter the written dialogue. (The common alternative name for a dramatic composition is a play.))</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Quinn, E. A dictionary of literary and thematic terms, c1999</subfield><subfield code="b">(drama: In its broadest sense, any work in which actors assume roles before an audience, either in a theater or on radio or television. Drama is a major literary genre, frequently subdivided into the categories of tragedy, comedy, and tragicomedy; play: A composition written to be performed)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">The American heritage dictionary of the English language, &#xA9;2000, updated 2009, via WWW, Mar. 11, 2014</subfield><subfield code="b">(theatrical, noun 1. Stage performances or a stage performance, especially by amateurs. Often used in the plural.)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Oxford dictionaries website, July 11, 2014</subfield><subfield code="b">(play, noun 3. A dramatic work for the stage or to be broadcast. Synonyms: drama, theatrical work; screenplay, comedy, tragedy; production, performance, show, sketch)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Merriam-Webster online, July 11, 2014</subfield><subfield code="b">(play noun 2. a written work in which the story is told through speech and action that is intended to be acted out on stage. Synonyms: drama, dramatization. Related Words: interlude, playlet; comedy, comedy drama, docudrama, dramedy, melodrama, monodrama, musical, musical comedy, psychodrama, tragedy, tragicomedy; magnum opus, opus, work; adaptation)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Wynston, G.P. Adapting stage drama for radio : techniques of preparing stage scripts for Canadian Broadcasting Corporation radio production, 1976.</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Vickers, S. Drama scripts for people with special needs, 2005.</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Hirsch, M.E. Chinese shadow theater playscripts, 1998.</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Chayefsky, P. The stage plays, 1995.</subfield></datafield><datafield tag="905" ind1="" ind2=""><subfield code="u">admin</subfield></datafield></record>	0
140	2021-08-05 10:05:30-05	2021-08-05 10:05:55.615308-05	import	<record xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns="http://www.loc.gov/MARC21/slim" xsi:schemaLocation="http://www.loc.gov/MARC21/slim http://www.loc.gov/standards/marcxml/schema/MARC21slim.xsd"><leader>03231nz  a2200253n  4500</leader><controlfield tag="001">2</controlfield><controlfield tag="005">20110517113815.0</controlfield><controlfield tag="008">110502 | anznnbabn          |a ana      </controlfield><datafield tag="010" ind1=" " ind2=" "><subfield code="a">gf2011026005</subfield><subfield code="z">sh2007004004</subfield></datafield><datafield tag="035" ind1=" " ind2=" "><subfield code="a">(DLC)gf2011026005</subfield></datafield><datafield tag="040" ind1=" " ind2=" "><subfield code="a">DLC</subfield><subfield code="b">eng</subfield><subfield code="c">DLC</subfield><subfield code="f">lcgft</subfield></datafield><datafield tag="155" ind1=" " ind2=" "><subfield code="a">Action and adventure films</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Action-adventure films</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Action films</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Action movies</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Adventure and action films</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Adventure films</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Adventure movies</subfield></datafield><datafield tag="555" ind1=" " ind2=" "><subfield code="w">g</subfield><subfield code="a">Motion pictures</subfield></datafield><datafield tag="555" ind1=" " ind2=" "><subfield code="a">Swashbuckler films</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Filmsite WWW site, May 21, 2008</subfield><subfield code="b">(Action films have tremendous impact, continuous high energy, lots of physical stunts and activity, possibly extended chase scenes, races, rescues, battles, martial arts, mountains and mountaineering, destructive disasters (floods, explosions, natural disasters, fires, etc.), fights, escapes, non-stop motion, spectacular rhythm and pacing, and adventurous heroes - all designed for pure audience escapism with the action sequences at the core of the film; The main action centers around a male action hero or protagonist; Adventure films are exciting stories, with new experiences or exotic locales. Adventure films are very similar to the action film genre, in that they are designed to provide an action-filled, energetic experience for the film viewer. Rather than the predominant emphasis on violence and fighting that is found in action films, however, the viewer of adventure films can live vicariously through the travels, conquests, explorations, creation of empires, struggles and situations that confront the main characters, actual historical figures or protagonists)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">GSAFD, 2000</subfield><subfield code="b">(Adventure films. UF Swashbucklers, Thrillers)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Yee, M.M. Moving image materials, 1988</subfield><subfield code="b">(Swashbucklers. Use for fictional genre films in which the protagonist, in period costume, fights, usually with his sword, for a noble cause. RT Epics; Thrillers: USE Crime drama, Disaster drama, Horror drama, Spy drama)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">The moving image genre-form guide, via WWW, Mar. 6, 2001</subfield><subfield code="b">(Adventure. Fictional work set in a historical period, from the Middle Ages through the 19th century, typically dramatizing the exploits of actual historical figures or incidents, including kings and battles, rebellion, piracy and the Spanish Main, travel, exploration, and the creation of empires. Larger ideological issues are mythicized and conflicts personalized over historical accuracy. Adventure usually involves a courageous, altruistic and patriotic hero willing to fight for his beliefs, who becomes involved in a struggle for freedom by overcoming oppression and helping to create a more just society. Used for Swashbuckler. Other genres often confused with Adventure include Ancient world, Animal, Aviation, Crime, Thriller, Science fiction, Survival, and War; for a comprehensive list, examine the see references under Action-adventure; Action-adventure see such genres as Adventure, Ancient world, Animal, Aviation, Caper, Crime, Disaster, Espionage, Fantasy, Gangster, Jungle, Martial arts, Mystery, Police, Prehistoric, Prison, Science fiction, Singing cowboy, Sports, Survival, Thriller, War, Western, Yukon)</subfield></datafield><datafield tag="905" ind1="" ind2=""><subfield code="u">admin</subfield></datafield></record>	0
141	2021-08-05 10:05:30-05	2021-08-05 10:05:55.275344-05	import	<record xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns="http://www.loc.gov/MARC21/slim" xsi:schemaLocation="http://www.loc.gov/MARC21/slim http://www.loc.gov/standards/marcxml/schema/MARC21slim.xsd"><leader>03994cz  a2200229n  4500</leader><controlfield tag="001">201</controlfield><controlfield tag="005">20151214151902.2</controlfield><controlfield tag="008">141201|| anznnbabn          |a ana     c</controlfield><datafield tag="010" ind1=" " ind2=" "><subfield code="a">gf2014026333</subfield></datafield><datafield tag="035" ind1=" " ind2=" "><subfield code="a">(DLC)gf2014026333</subfield></datafield><datafield tag="040" ind1=" " ind2=" "><subfield code="a">IlChALCS</subfield><subfield code="b">eng</subfield><subfield code="c">DLC</subfield><subfield code="f">lcgft</subfield><subfield code="d">DLC</subfield></datafield><datafield tag="155" ind1=" " ind2=" "><subfield code="a">Fantasy fiction</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Fantastic fiction</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Heroic fantasy fiction</subfield></datafield><datafield tag="555" ind1=" " ind2=" "><subfield code="w">g</subfield><subfield code="a">Fiction</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Saricks, J. Readers' advisory guide to genre fiction, 2009:</subfield><subfield code="b">pp. 265-267 (Fantasy: Fantasy exists in a world that most people believe never could be, while Science Fiction worlds are those we accept as possible, even if improbable. Science Fiction generally offers something radically new and different, but Fantasy frequently takes a familiar story, legend, or myth and adds a twist, a new way of looking at things that brings it to life again. The key to Fantasy, however, is the presence of magic. If there is no magic, the story may fit in the Horror, Science Fiction, Romance, Historical Fiction, or Adventure genres. When magic is integral to the story, it must be Fantasy. The presence of magic or enchantment is the element that most clearly distinguishes Fantasy from other genres. Magic may manifest itself in the existence of a magical sword or magical powers; there may be creatures that readers know can exist in none but a magical world; or there may be a feeling of otherness, a sense of enchantment that grows throughout the story)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Wheeler, K. Literary terms and definitions, via WWW, Jan. 3, 2013</subfield><subfield code="b">(fantasy novel: Any novel that is removed from reality--especially those novels set in nonexistent worlds, such as an elvish kingdom, on the moon, in Pellucidar (the hollow center of the earth), or in alternative versions of the historical world--such as a version of London where vampires or sorcerers have seized control of parliament. The characters are often something other than humans, or human characters may interact with nonhuman characters such as trolls, dragons, munchkins, kelpies, etc. Examples include J. R. R. Tolkien's The Hobbit, Ursula LeGuin's A Wizard of Earthsea, Michael Moorcock's The Dreaming City, or T. H. White's The Once and Future King)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Manlove, C. Modern fantasy, 1975:</subfield><subfield code="b">p. 1 (a fantasy is: a fiction evoking wonder and containing a substantial and irreducible element of the supernatural with which the mortal characters in the story or the readers become on at least partly familiar terms) p. 7 (wonder is of course generated by fantasy purely from the presence of the supernatural or impossible, and from the element of mystery and lack of explanation that goes with it. The science fiction writer throws a rope of the conceivable (how remotely so does not matter) from our world to his: the fantasy writer does not) p. 8 (Fantasy often draws spiritual nourishment from the past, particularly from a medieval and/or Christian world order; whereas science fiction is usually concerned with the future and the way we may develop) p. 9 (the supernatural or impossible in fantasy is not simply strange and wonderful; the reader becomes partially familiar with or at home in the marvellous worlds presented, and the mortal characters establish relationships with beings or objects from the 'beyond'; it is this, more than anything else, that distinguishes fantasy from the ghost and horror story. In the latter the supernatural is left entirely alien, for the point is the shock)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Ruse, C. The Cassell dict. of lit. and lang., 1992</subfield><subfield code="b">(Fantasy: any piece of writing that extends the imagination beyond what seems possible; often inventing imaginary worlds set in the past and future)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">GSAFD, 2000</subfield><subfield code="b">(Fantasy fiction. Use for works that feature imaginary worlds, extraordinary creatures, sorcerers, epic quests or magic)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">LCSH, Oct. 22, 2014</subfield><subfield code="b">(Fantasy fiction. UF Fantastic fiction; Heroic fantasy (Fiction))</subfield></datafield><datafield tag="680" ind1=" " ind2=" "><subfield code="i">Fiction in which magic and extraordinary characters are integral to the story.</subfield></datafield><datafield tag="905" ind1="" ind2=""><subfield code="u">admin</subfield></datafield></record>	0
