143	2021-08-05 10:05:30-05	2021-08-05 10:05:54.804077-05	import	<record xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns="http://www.loc.gov/MARC21/slim" xsi:schemaLocation="http://www.loc.gov/MARC21/slim http://www.loc.gov/standards/marcxml/schema/MARC21slim.xsd"><leader>00960nz  a2200169n  4500</leader><controlfield tag="001">202</controlfield><controlfield tag="005">20150513181123.9</controlfield><controlfield tag="008">141201|| anznnbabn          |a ana     c</controlfield><datafield tag="010" ind1=" " ind2=" "><subfield code="a">gf2014026339</subfield></datafield><datafield tag="035" ind1=" " ind2=" "><subfield code="a">(DLC)gf2014026339</subfield></datafield><datafield tag="040" ind1=" " ind2=" "><subfield code="a">IlChALCS</subfield><subfield code="b">eng</subfield><subfield code="c">DLC</subfield><subfield code="f">lcgft</subfield></datafield><datafield tag="155" ind1=" " ind2=" "><subfield code="a">Fiction</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Stories</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Tales</subfield></datafield><datafield tag="555" ind1=" " ind2=" "><subfield code="w">g</subfield><subfield code="a">Literature</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Baldick, C. Oxford dictionary of literary terms, c2008</subfield><subfield code="b">(Fiction: the general term for invented stories, now usually applied to novels, short stories, novellas, romances, fables and other narrative works in prose, even though most plays and narrative poems are also fictional.)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Britannica online, April 12, 2012</subfield><subfield code="b">(Fiction: literature created from the imagination, not presented as fact, though it may be based on a true story or situation. Types of literature in the fiction genre include the novel, short story, and novella. The word is from the Latin ficti&#x14D;, "the act of making, fashioning, or molding.")</subfield></datafield><datafield tag="905" ind1="" ind2=""><subfield code="u">admin</subfield></datafield></record>	0
