ld><subfield code="b">(science fiction: Literature in which speculative technology, time travel, alien races, intelligent robots, gene-engineering, space travel, experimental medicine, psionic abilities, dimensional portals, or altered scientific principles contribute to the plot or background. Many purists make a distinction between "hard" science fiction (in which the story attempts to follow accepted scientific realism and extrapolates the outcomes or consequences of scientific discovery in a hard-headed manner) and "soft" science fiction (which often involves looser adherence to scientific knowledge and more fantasy-elements))</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">GSAFD, 2000</subfield><subfield code="b">(science fiction: used for works of fantasy that deal with possible though not necessarily probable events and are based approximately on scientific principles, e.g. space travel, time travel, etc. Used also for works in which mankind confronts alien cultures or environments)</subfield></datafield><datafield tag="680" ind1=" " ind2=" "><subfield code="i">Fiction that depicts imagined scientific or technological advances (e.g., time travel, artificial intelligence) and their impact on society.</subfield></datafield><datafield tag="905" ind1="" ind2=""><subfield code="u">admin</subfield></datafield></record>	0
