ing of a book, often in abridged form)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Wikipedia, Mar. 10, 2008</subfield><subfield code="b">(audiobook; a recording that is primarily of the spoken word as opposed to music; not intended to be descriptive of the word "book" but rather a recorded spoken program in its own right and not always an audio version of a book)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Montana State Library website, Mar. 10, 2008:</subfield><subfield code="b">Montana Talking Book Library (cassette books; recorded books)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">NetLibrary web site, Mar. 10, 2008</subfield><subfield code="b">(books on tape)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">LCSH, Mar. 10, 2008</subfield><subfield code="b">(hdg: Audiobooks)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">OED online, April 27, 2010:</subfield><subfield code="b">audiobook (an audio recording of a reading of a book (typically a novel), produced commercially)</subfield></datafield><datafield tag="680" ind1=" " ind2=" "><subfield code="i">Recordings of oral readings of books.</subfield></datafield><datafield tag="681" ind1=" " ind2=" "><subfield code="i">Example under</subfield><subfield code="a">Sound recordings</subfield></datafield><datafield tag="905" ind1="" ind2=""><subfield code="u">admin</subfield></datafield></record>	0
183	2021-08-05 10:05:30-05	2021-08-05 10:05:45.243692-05	import	<record xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns="http://www.loc.gov/MARC21/slim" xsi:schemaLocation="http://www.loc.gov/MARC21/slim http://www.loc.gov/standards/marcxml/schema/MARC21slim.xsd"><leader>03994cz  a2200229n  4500</leader><controlfield tag="001">369126</controlfield><controlfield tag="005">20151214151902.2</controlfield><controlfield tag="008">141201|| anznnbabn          |a ana     c</controlfield><datafield tag="010" ind1=" " ind2=" "><subfield code="a">gf2014026333</subfield></datafield><datafield tag="035" ind1=" " ind2=" "><subfield code="a">(DLC)gf2014026333</subfield></datafield><datafield tag="040" ind1=" " ind2=" "><subfield code="a">IlChALCS</subfield><subfield code="b">eng</subfield><subfield code="c">DLC</subfield><subfield code="f">lcgft</subfield><subfield code="d">DLC</subfield></datafield><datafield tag="155" ind1=" " ind2=" "><subfield code="a">Fantasy fiction</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Fantastic fiction</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Heroic fantasy fiction</subfield></datafield><datafield tag="555" ind1=" " ind2=" "><subfield code="w">g</subfield><subfield code="a">Fiction</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Saricks, J. Readers' advisory guide to genre fiction, 2009:</subfield><subfield code="b">pp. 265-267 (Fantasy: Fantasy exists in a world that most people believe never could be, while Science Fiction worlds are those we accept as possible, even if improbable. Science Fiction generally offers something radically new and different, but Fantasy frequently takes a familiar story, legend, or myth and adds a twist, a new way of looking at things that brings it to life again. The key to Fantasy, however, is the presence of magic. If there is no magic, the story may fit in the Horror, Science Fiction, Romance, Historical Fiction, or Adventure genres. When magic is integral to the story, it must be Fantasy. The presence of magic or enchantment is the element that most clearly distinguishes Fantasy from other genres. Magic may manifest itself in the existence of a magical sword or magical powers; there may be creatures that readers know can exist in none but a magical world; or there may be a feeling of otherness, a sense of enchantment that grows throughout the story)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Wheeler, K. Literary terms and definitions, via WWW, Jan. 3, 2013</subfield><subfield code="b">(fantasy novel: Any novel that is removed from reality--especially those novels set in nonexistent worlds, such as an elvish kingdom, on the moon, in Pellucidar (the hollow center of the earth), or in alternative versions of the historical world--such as a version of London where vampires or sorcerers have seized control of parliament. The characters are often something other than humans, or human characters may interact with nonhuman characters such as trolls, dragons, munchkins, kelpies, etc. Examples include J. R. R. Tolkien's The Hobbit, Ursula LeGuin's A Wizard of Earthsea, Michael Moorcock's The Dreaming City, or T. H. White's The Once and Future King)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Manlove, C. Modern fantasy, 1975:</subfield><subfield code="b">p. 1 (a fantasy is: a fiction evoking wonder and containing a substantial and irreducible element of the supernatural with which the mortal characters in the story or the readers become on at least partly familiar terms) p. 7 (wonder is of course generated by fantasy purely from the presence of the supernatural or impossible, and from the element of mystery and lack of explanation that goes with it. The science fiction writer throws a rope of the conceivable (how remotely so does not matter) from our world to his: the fantasy writer does not) p. 8 (Fantasy often draws spiritual nourishment from the past, particularly from a medieval and/or Christian world order; whereas science fiction is usually concerned with the future and the way we may develop) p. 9 (the supernatural or impossible in fantasy is not simply strange and wonderful; the reader becomes partially familiar with or at home in the marvellous worlds presented, and the mortal characters establish relationships with beings or objects from the 'beyond'; it is this, more than anything else, that distinguishes fantasy from the ghost and horror story. In the latter the supernatural is left entirely alien, for the point is the shock)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Ruse, C. The Cassell dict. of lit. and lang., 1992</subfield><subfield code="b">(Fantasy: any piece of writing that extends the imagination beyond what seems possible; often inventing imaginary worlds set in the past and future)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">GSAFD, 2000</subfield><subfield code="b">(Fantasy fiction. Use for works that feature imaginary worlds, extraordinary creatures, sorcerers, epic quests or magic)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">LCSH, Oct. 22, 2014</subfield><subfield code="b">(Fantasy fiction. UF Fantastic fiction; Heroic fantasy (Fiction))</subfield></datafield><datafield tag="680" ind1=" " ind2=" "><subfield code="i">Fiction in which magic and extraordinary characters are integral to the story.</subfield></datafield><datafield tag="905" ind1="" ind2=""><subfield code="u">admin</subfield></datafield></record>	0
184	2021-08-05 10:05:30-05	2021-08-05 10:05:45.003412-05	import	<record xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns="http://www.loc.gov/MARC21/slim" xsi:schemaLocation="http://www.loc.gov/MARC21/slim http://www.loc.gov/standards/marcxml/schema/MARC21slim.xsd"><leader>01348cz  a2200169n  4500</leader><controlfield tag="001">369165</controlfield><controlfield tag="005">20160205154811.9</controlfield><controlfield tag="008">141201|| anznnbabn          |a ana     c</controlfield><datafield tag="010" ind1=" " ind2=" "><subfield code="a">gf2014026424</subfield></datafield><datafield tag="035" ind1=" " ind2=" "><subfield code="a">(DLC)gf2014026424</subfield></datafield><datafield tag="040" ind1=" " ind2=" "><subfield code="a">IlChALCS</subfield><subfield code="b">eng</subfield><subfield code="c">DLC</subfield><subfield code="f">lcgft</subfield><subfield code="d">DLC</subfield></datafield><datafield tag="155" ind1=" " ind2=" "><subfield code="a">Magic realist fiction</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Magical realist fiction</subfield></datafield><datafield tag="555" ind1=" " ind2=" "><subfield code="w">g</subfield><subfield code="a">Fiction</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Oxford dictionary of literary terms, via Oxford reference online, Nov. 5, 2012</subfield><subfield code="b">(magic realism: also magical realism; kind of modern fiction in which fabulous and fantastical events are included in a narrative that otherwise maintains the 'reliable' tone of objective realistic report; associated chiefly with certain leading novelists of Central and South America; term has also been extended to works from very different cultures, designating a tendency of the modern novel to reach beyond the confines of realism and draw upon the energies of fable, folktale and myth while retaining a strong contemporary social relevance)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Britannica online academic edition, Nov. 15, 2012</subfield><subfield code="b">(magic realism: chiefly Latin-American narrative strategy that is characterized by the matter-of-fact inclusion of fantastic or mythical elements into seemingly realistic fiction)</subfield></datafield><datafield tag="680" ind1=" " ind2=" "><subfield code="i">Modern fiction in which fantastic or mythical elements are included in a narrative that is otherwise realistic.</subfield></datafield><datafield tag="905" ind1="" ind2=""><subfield code="u">admin</subfield></datafield></record>	0
185	2021-08-05 10:05:30-05	2021-08-05 10:05:44.679694-05	import	<record xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns="http://www.loc.gov/MARC21/slim" xsi:schemaLocation="http://www.loc.gov/MARC21/slim http://www.loc.gov/standards/marcxml/schema/MARC21slim.xsd"><leader>01694cz  a2200241n  4500</leader><controlfield tag="001">37</controlfield><controlfield tag="005">20160909085249.6</controlfield><controlfield tag="008">110505|| anznnbabn          |a ana      </controlfield><datafield tag="010" ind1=" " ind2=" "><subfield code="a">gf2011026250</subfield><subfield code="z">sh2007025004</subfield></datafield><datafield tag="035" ind1=" " ind2=" "><subfield code="a">(DLC)gf2011026250</subfield></datafield><datafield tag="040" ind1=" " ind2=" "><subfield code="a">DLC</subfield><subfield code="b">eng</subfield><subfield code="c">DLC</subfield><subfield code="f">lcgft</subfield><subfield code="d">DLC</subfield><subfield code="d">WaU</subfield></datafield><datafield tag="155" ind1=" " ind2=" "><subfield code="a">Fiction films</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Dramatic films</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Dramatic-narrative films</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Entertainment films</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Fictional films</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Fictive films</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Film dramas</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Narrative films</subfield></datafield><datafield tag="555" ind1=" " ind2=" "><subfield code="w">g</subfield><subfield code="a">Motion pictures</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Yee, M. Moving image materials, 1988</subfield><subfield code="b">(Fiction: use for films and programs portraying imaginary characters and events)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Films by genre, c1993</subfield><subfield code="b">(fictional film; UF dramatic-narrative film, fiction film, fictive film; the fictional film -- film drama, film play, screen drama, screenplay, or story film as it has sometimes been called -- is a film in which actors perform in front of a camera to create fictitious situations or tell an invented story with the purpose of showing it to an audience; hence the terms entertainment film, theatrical film, and feature film have also been used with analogous meaning; fictional film or fiction film stands in opposition to factual or documentary film)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Konigsberg, I. The complete film dictionary, 1997</subfield><subfield code="b">(narrative film. Any film that tells a story; also called a fiction film, a dramatic film, a theatrical film, and a feature film. Though a number of documentaries have a simple narrative line embedded within them and some seem to tell stories, the term "narrative film" applies to those works that emphasize the story line, are dramatic in nature, and are fictional.)</subfield></datafield><datafield tag="905" ind1="" ind2=""><subfield code="u">admin</subfield></datafield></record>	0
