188	2021-08-05 10:05:30-05	2021-08-05 10:05:43.888142-05	import	<record xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xmlns="http://www.loc.gov/MARC21/slim" xsi:schemaLocation="http://www.loc.gov/MARC21/slim http://www.loc.gov/standards/marcxml/schema/MARC21slim.xsd"><leader>03144cz  a2200253n  4500</leader><controlfield tag="001">39</controlfield><controlfield tag="005">20160412142123.1</controlfield><controlfield tag="008">110506|| anznnbabn          |a ana      </controlfield><datafield tag="010" ind1=" " ind2=" "><subfield code="a">gf2011026254</subfield><subfield code="z">sh2007025327</subfield><subfield code="z">gf2014026598</subfield></datafield><datafield tag="035" ind1=" " ind2=" "><subfield code="a">(DLC)gf2011026254</subfield></datafield><datafield tag="040" ind1=" " ind2=" "><subfield code="a">DLC</subfield><subfield code="b">eng</subfield><subfield code="c">DLC</subfield><subfield code="f">lcgft</subfield><subfield code="d">DLC</subfield><subfield code="d">WaU</subfield></datafield><datafield tag="155" ind1=" " ind2=" "><subfield code="a">Film adaptations</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Books, Filmed</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Dramatisations</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Dramatizations</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Filmed books</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Films from books</subfield></datafield><datafield tag="455" ind1=" " ind2=" "><subfield code="a">Motion picture adaptations</subfield></datafield><datafield tag="555" ind1=" " ind2=" "><subfield code="w">g</subfield><subfield code="a">Adaptations</subfield></datafield><datafield tag="555" ind1=" " ind2=" "><subfield code="w">g</subfield><subfield code="a">Motion pictures</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Moving image genre-form guide, via WWW, July 18, 2007:</subfield><subfield code="b">(adaptation: Fiction or nonfiction work taken from a work already existing in another medium, such as a book, short story, comic strip, radio program, or play)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Oxford dictionaries online, Jan. 9, 2016</subfield><subfield code="b">(dramatization 1. A play or movie adapted from a novel or depicting a particular incident. 1.1. The process of adapting a novel or presenting a particular incident in a play or movie)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Baldick, C. The Oxford dictionary of literary terms, 2008</subfield><subfield code="b">(dramatization: The process of adaptation whereby a stage play or film drama is created from major elements (plot, characters, settings) derived from a non-dramatic literary or historical work, usually a novel, romance, short story, or biography; or the new dramatic work thereby created.)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">OCLC, Jan. 19, 2016</subfield><subfield code="b">(notes: Film dramatization of Shakespeare's story of the love affair between Mark Antony and Cleopatra, and its destructive consequences; Film dramatisation of Hugo's novel; A film dramatization of Shakespeare's play about two sets of lovers who sort out their problems with fairy help in the midnight woods of Athens; A film dramatization of the life of poet and novelist, Reinaldo Arenas, based on the memoir Before night falls; Film dramatization of the political struggle between Danton and Robespierre during 1794 in Paris which culminated in the execution of Danton; Set in Vienna, 1885, this film dramatization follows the struggles of Sigmund Freud as a young doctor facing the ridicule of his peers as he attempts to disprove standing medical theories relating to the dark recesses of the mind; A film dramatization of the life of Napoleon Velasco, a public school teacher who becomes a policeman; A film dramatization of the world of the Ugandan dictator Idi Amin Dada, who, in abusing his power, ravaged a half-million lives; A film dramatization of Oscar Wilde's unsuccessful libel suit against the Marquis of Queensberry after he accused Wilde of seducing his son, and Wilde's subsequent trial for sodomy, resulting in Wilde's imprisonment. Based on the book The trials of Oscar Wilde by Montgomery Hyde, and the play The stringed lute by John Furnell; A vivid, compelling film dramatization of Hugo's great novel, which provides students with an excellent historical and social portrait of France-and particularly Paris-at mid-19th century; A film dramatisation of how the events of 11 September 2001 change the lives of three very different families, in Berlin; Film dramatisation of Oscar Wilde's life)</subfield></datafield><datafield tag="905" ind1="" ind2=""><subfield code="u">admin</subfield></datafield></record>	0
