films; vidpics; movies made-for-television; the made-for-TV movie is a rich and varied genre, encompassing its own unique formal, stylistic, and topical strategies on which the process of definition and evaluation can continue to develop; can be divided into three categories/subgenres: the telefeature, the docudrama, and the mini-series; telefeature refers to a fictional narrative produced for TV that is a discrete entity occupying at least 90 "commercial" minutes but not exceeding one evening of programming; docudrama is a story film designed to recreate actual persons, places, and events; mini-series is an extended telefeature or docudrama that is broadcast in multiple segments over two or more nights) pp. 175-180 (videography includes: Brian's Song; The Night Stalker; That Certain Summer; Rich Man, Poor Man; Sybil; Roots; Holocaust; Shogun; The Day After)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">The television genre book, 2001:</subfield><subfield code="b">p. 13 (made-for-TV movie)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Singleton, R.S. Filmmaker's dict., c2000</subfield><subfield code="b">(made-for-TV movie: Film produced for airing on television. Later, it may have a domestic video or foreign theatrical release. Also called a movie for television, TV movie, telefilm or telepic)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Yee, M.M. Moving image materials, 1988</subfield><subfield code="b">(Made for TV movies. Use for a feature-length fictional fictional film made for television broadcast rather than for theatrical release. UF Films on television, Movies on television, TV movies, Telefeatures, Television broadcasting of films (LCSH), Television films, Television movies)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">The moving image genre-form guide, via WWW, Mar. 29, 2002</subfield><subfield code="b">(Television feature. Individual fictional work (often called "Made for TV movie") presented on television, usually running from 90 minutes to three hours in length (which may include commercials), and is not part of a regular series or mini-series. Used for Made for TV movie; Television movie)</subfield></datafield><datafield tag="670" ind1=" " ind2=" "><subfield code="a">Google search, Mar. 1, 2009</subfield><subfield code="b">(television feature films; made-for-television feature films; made-for-TV feature films; TV films)</subfield></datafield><datafield tag="905" ind1="" ind2=""><subfield code="u">admin</subfield></datafield></record>	0
