afield><datafield tag="546" ind1=" " ind2=" "><subfield code="a">English, Spanish audio.</subfield></datafield><datafield tag="546" ind1=" " ind2=" "><subfield code="a">English subtitles for the deaf and hard of hearing.</subfield></datafield><datafield tag="520" ind1=" " ind2=" "><subfield code="a">He was one of the best-known men of the 20th century, a three-time heavyweight boxing champion who captivated millions of fans throughout the world with his mesmerizing combination of speed, grace, and power in the ring, and charm and playful boasting outside of it. At the height of his fame, he took American life, the racial prejudices, the religious biases, the role of celebrities, the role of sports in society, and refashioned it in his image. His brazen outspokenness and unsurpassed boxing skills made him a heroic symbol of black masculinity to African Americans across the country, yet at times he seemed to take pride in humiliating his black opponents. In an age of sit-ins and freedom rides aimed at ending segregation, his deep ties to the Nation of Islam, a black nationalist organization that preached separation, made him, for a time, among the most feared and reviled men in the country. At the peak of his ability, he bravely sacrificed his career by refusing to go to war in Vietnam, and though he was condemned for it, Muhammad Ali would later be celebrated as a principled pacifist.  Includes Spanish SDH subtitles.</subfield></datafield><datafield tag="650" ind1=" " ind2="4"><subfield code="a">African-American Heritage.</subfield></datafield><datafield tag="650" ind1=" " ind2="4"><subfield code="a">Documentary.</subfield></datafield><datafield tag="655" ind1=" " ind2="4"><subfield code="a">Documentary.</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Ali, Muhammad</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">David, Keith</subfield></datafield><datafield tag="856" ind1="7" ind2=" "><subfield code="3">