 ind2=" "><subfield code="a">Read by Clare Corbett, Daphne Kouma, Julia Winwood, Sope Dirisu, Sofia Zervudachi, Charlie Anson.</subfield></datafield><datafield tag="520" ind1=" " ind2=" "><subfield code="a">Jess needs a fresh start. She's broke and alone, and she's just left her job under less than ideal circumstances. Her half-brother Ben didn't sound thrilled when she asked if she could crash with him for a bit, but he didn't say no, and surely everything will look better from Paris. Only when she shows up, to find a very nice apartment, (could Ben really have afforded this?) he's not there. The longer Ben stays missing, the more Jess starts to dig into her brother's situation, and the more questions she has. Ben's neighbors are an eclectic bunch, and not particularly friendly. Jess may have come to Paris to escape her past, but it's starting to look like it's Ben's future that's in question. The socialite. The nice guy. The alcoholic. The girl on the verge. The concierge. Everyone's a neighbor. Everyone's a suspect. And everyone knows something they're not telling.</subfield></datafield><datafield tag="650" ind1=" " ind2="4"><subfield code="a">Women'S Fiction.</subfield></datafield><datafield tag="650" ind1=" " ind2="4"><subfield code="a">Suspense / Thriller.</subfield></datafield><datafield tag="655" ind1=" " ind2="4"><subfield code="a">Audiobooks.</subfield></datafield><datafield tag="655" ind1=" " ind2="4"><subfield code="a">Fiction.</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Corbett, Clare</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Kouma, Daphne</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Winwood, Julia</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Dirisu, Sope</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Zervudachi, Sofia</subfield></datafield><datafield tag="700" ind1="1" ind2=" ">